package assignment2;

public class NestedLoops {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
      int n=6;
      int m=6;
      for(int i=0;i<n;i++) {
    	  for(int j=0;j<m;j++) {
    		  System.out.println("("+i+","+j+")");
    	  }
    	  System.out.println();
      }
	}

}
